import React from 'react'
import "../style/Skills.scss";
import Particles from 'react-particles-js';

// Elements
import particles from "../constants/Particles2";


function Skills() {
    return(
        <div class="skills-container">
            <div class="skills-bg">
             <Particles 
              className="particles"
              params={particles}
            />
                <img src="./Skills.png" />
            </div>
        </div>
    )
}

export default Skills
